import { StatusBar } from "expo-status-bar";
import React, { useState } from "react";
import { StyleSheet, Text, View, TextInput, Button } from "react-native";

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={styles.title}>AGENCIA TURISMO</Text>
      <View>
        <Text>IDENTIFICACION</Text>
        <TextInput style={styles.inputs}></TextInput>

        <Text>NOMBRE</Text>
        <TextInput style={styles.inputs}></TextInput>

        <Text>DESTINO</Text>
        <TextInput style={styles.inputs}></TextInput>

        <Text>NUMERO PERSONAS</Text>
        <TextInput style={styles.inputs}></TextInput>

        <Text>NÃšMERO DE DIAS:</Text>
        <TextInput style={styles.inputs}></TextInput>

        <Text>ADICIONALES:</Text>
        <TextInput style={styles.inputs}></TextInput>

        <Text>TOTAL A PAGAR:</Text>
        <TextInput style={styles.inputs}></TextInput>
      </View>
      <View style={styles.footer}>
        <Button style={styles.button} title="Calcular"></Button>
        <Text>{"\n"}</Text>
        <Button style={styles.button} title="Limpiar" >
          Limpiar
        </Button>
      </View>
      <StatusBar style="auto" />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },

  title: {
    fontSize: 60,
    fontWeight: 10,
    fontFamily: "Neucha",
    color: "red",
  },

  inputs: {
    border: "2px solid #000",
    borderRadius: 5,
    marginBottom: 15,
    color: "blue",
    height: 40,
  },

  button: {
    height: 50,
    width: 20,
    marginTop: 20,
  },

  footer: {
    marginTop: 40,
    display: "block",
  },

  error: {
    color: "red",
  },
});
